import axios from 'axios';

const fetchUser = (user) => (dispatch) => {
  console.log(user);
  axios
    .post(`https://jastegri.pythonanywhere.com/auth/users/`, {
      username: 'scsa',
      password: 'fef64f84f6fs',
    })
    .then(({ data }) => {
      // localStorage.setItem('token', data.jwt);
      console.log(data);
      // dispatch(regisUser(data));
    });
};

const regisUser = (userObj) => ({
  type: 'REGIS_USER',
  payload: userObj,
});

export { fetchUser };
